import React from 'react'
import IMG from '../assets/loginbg.jpg'

const Card = (props) => {
   
    return (
        <div className='w-4/6 h-3/5 shadow-cardShadow mb-15 p-15 mt-12 m-auto rounded-tr-3xl'>
            <section className='w-full block image'> 
            <img src={props.img} alt='img' className='block rounded-tr-3xl h-1/6 m-auto' />
            </section>
            <section className=" p-6 rounded-bl-3xl h-1/3 m-auto mb-15" style={{'background':props.color}}>
                
            </section>
        </div>


    )

   
}

export default Card;
